import logo from './logo.svg';
import './App.css';
import Navication from '../components/navigation/navigation';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <Navication/>
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit
        </p>


      </header>
    </div>
  );
}

export default App;
